webpackJsonp([0x5b8364c1e45c],{7816:function(t,e){t.exports={data:{post:{html:'<p>MamaMaus has once again graced the pages of the Bild Zeitung, this time not just the Hamburg edition, but nationwide on Page 2: <a href="http://www.bild.t-online.de/BTO/news/2007/03/06/job-wunder/mittelstand-motor.html"><em>Jobwunder Mittelstand</em></a> (online edition, click through the <em>Mehr zum Thema</em> box, or <a href="http://www.bild.t-online.de/BTO/news/2007/03/06/job-wunder/kt-galerie-jobwunder,templateId=renderInline,rendertext=1489534.html">look here for just her</a>), although I\'m not sure her employer, an American DJIA-listed corporation, really qualifies as German Mittelstand. The caption is pretty much the same as <a href="http://www.papascott.de/archives/2006/11/27/bild-hamburg-page-6/">last time</a>.</p>\n<p>The paper should still be on the newsstands, buy it before it sells out. Or check out the <a href="http://aycu05.webshots.com/image/10524/2001190113226454148_rs.jpg">scan</a><br />\n :-)</p>\n<p><a href="http://aycu05.webshots.com/image/10524/2001190113226454148_rs.jpg"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/03/bild-mittelstand.jpg" alt="Bild Mittelstand" /></a></p>',fields:{title:"This Time Nationwide",date:"06 Mar 2007",url:"https://papascott.de/2007-03-06-this-time-nationwide/"}}},pathContext:{slug:"/2007-03-06-this-time-nationwide/",prev:{fields:{title:"Fifty States in Ten Minutes",date:"05 Mar 2007",slug:"/2007-03-05-fifty-states-in-ten-minutes/"}},next:{fields:{title:"Kids Marketing",date:"08 Mar 2007",slug:"/2007-03-08-kids-marketing/"}}}}}});
